import React, { useEffect, useState } from "react";
import axios from "axios";

const Orders = () => {
  const [orders, setOrders] = useState([]);

  useEffect(() => {
    fetchOrders();
  }, []);

  const fetchOrders = async () => {
    try {
      const res = await axios.get("http://localhost:5000/api/orders");
      console.log("Fetched orders:", res.data);  // Log fetched orders
      setOrders(res.data);  // Set state to display orders
    } catch (err) {
      console.error("Failed to fetch orders:", err);  // Log error if any
    }
  };

  return (
    <div className="p-4">
      <h1 className="mb-4 fw-bold">Orders</h1>
      <div className="table-responsive">
        <Table columns={["Order ID", "Customer ID", "Total Price", "Date"]} data={orders} />
      </div>
    </div>
  );
};

export default Orders;
